   {
      "desc":"Training Classification from OData",
      "type":"classification",
      "language":"en",
      "business_object":"ticket"
   },
   "mapping":
   {
        "input": ["Name", "Text"],
        "output": ["ServiceIssueCategoryID"]
   },
