            "service_url": "{{odata_service_url}}",
            "authorization": "{{odata_authorization}}"
        },
        "application":"C4C",
        "query_options":
        {
            "entity":"ServiceRequestCollection",
            "select":"Name,ServiceIssueCategoryID",
            "filter":"ETag ge datetimeoffset'2018-09-07T07:32:10.00Z' and ETag le datetimeoffset'2018-09-07T08:53:35.00Z' and ServiceIssueCategoryID ne null",
